def encrypt(s):
    result = ''
    for char in s:
        if char.isalpha():
            shift = 2 * ord(char) - 2
            if char.islower():
                new_char = chr((ord('a') + (ord(char) - ord('a') + shift) % 26))
            else:
                new_char = chr((ord('A') + (ord(char) - ord('A') + shift) % 26))
            result += new_char
        else:
            result += char
    return result

