def minPath(grid, k):
    n = len(grid)
    visited = set()
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    def dfs(i, j, path):
        if len(path) == k:
            return path

        visited.add((i, j))
        min_path = None

        for dx, dy in directions:
            x, y = i + dx, j + dy
            if 0 <= x < n and 0 <= y < n and (x, y) not in visited:
                new_path = dfs(x, y, path + [grid[x][y]])
                if not min_path or new_path < min_path:
                    min_path = new_path

        visited.remove((i, j))
        return min_path

    start_values = [(i, j) for i in range(n) for j in range(n)]
    min_path = None

    for i, j in start_values:
        path = dfs(i, j, [grid[i][j]])
        if not min_path or path < min_path:
            min_path = path

    return min_path

