def minPath(grid, k):
    n = len(grid)
    start = min(min(row) for row in grid)
    path = [start]
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def dfs(i, j, visited):
        if len(path) == k:
            return

        for di, dj in directions:
            ni, nj = i + di, j + dj
            if 0 <= ni < n and 0 <= nj < n and (ni, nj) not in visited:
                path.append(grid[ni][nj])
                visited.add((ni, nj))
                dfs(ni, nj, visited)
                if len(path) == k:
                    return
                path.pop()
                visited.remove((ni, nj))

    for i in range(n):
        for j in range(n):
            if grid[i][j] == start:
                dfs(i, j, set([(i, j)]))
                break

    return path

