def simplify(x, n):
    x_num, x_denom = map(int, x.split('/'))
    n_num, n_denom = map(int, n.split('/'))

    result = x_num * n_num / (x_denom * n_denom)

    return result.is_integer()

def get_max_triples(n):
    count = 0
    a = [i*i - i + 1 for i in range(1, n+1)]
    for i in range(n):
        for j in range(i+1, n):
            for k in range(j+1, n):
                if (a[i] + a[j] + a[k]) % 3 == 0:
                    count += 1
    return count

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]

    if planet1 not in planets or planet2 not in planets:
        return ()

    start_index = planets.index(planet1)
    end_index = planets.index(planet2)

    if start_index < end_index:
        return tuple(sorted(planets[start_index+1:end_index], key=planets.index))
    else:
        return tuple(sorted(planets[end_index+1:start_index], key=planets.index))

