def separate_paren_groups(paren_string: str) -> List[str]:
    result = []
    stack = []
    current_group = ''

    for char in paren_string:
        if char == '(':
            stack.append('(')
        elif char == ')':
            stack.pop()

        current_group += char

        if not stack:
            result.append(current_group.replace(' ', ''))
            current_group = ''

    return result

def below_zero(operations: List[int]) -> bool:
