def encrypt(s):
    encrypted = ""
    for char in s:
        if char.isalpha():
            shift = 2 * ord(char) + 2
            if char.islower():
                encrypted += chr((shift - 97) % 26 + 97)
            else:
                encrypted += chr((shift - 65) % 26 + 65)
        else:
            encrypted += char
    return encrypted

