    return sign * magnitude_sum

def minPath(grid, k):
    n = len(grid)
    directions = [(0, 1), (1, 0), (0, -1), (-1, 0)]

    def dfs(i, j, path):
        if len(path) == k:
            return path

        min_path = None
        for di, dj in directions:
            ni, nj = i + di, j + dj
            if 0 <= ni < n and 0 <= nj < n:
                new_path = dfs(ni, nj, path + [grid[ni][nj]])
                if min_path is None or new_path < min_path:
                    min_path = new_path

        return min_path

    min_val = min(min(row) for row in grid)
    start_pos = [(i, j) for i in range(n) for j in range(n) if grid[i][j] == min_val]

    result = dfs(start_pos[0][0], start_pos[0][1], [min_val])

    return result

