def encrypt(s):
    encrypted = ""
    for char in s:
        if char.isalpha():
            shift = 2 * (ord(char.lower()) - ord('a'))
            new_char = chr(((ord(char.lower()) - ord('a') + shift) % 26) + ord('a'))
            if char.isupper():
                encrypted += new_char.upper()
            else:
                encrypted += new_char
        else:
            encrypted += char
    return encrypted

