def encrypt(s):
    result = ''
    for char in s:
        if char.isalpha():
            shift = 2 * ord(char.lower()) - 194
            encrypted_char = chr((shift % 26) + ord('a'))
            if char.isupper():
                encrypted_char = encrypted_char.upper()
            result += encrypted_char
        else:
            result += char
    return result

