def minPath(grid, k):
    N = len(grid)
    def dfs(i, j, path):
        if len(path) == k:
            return path
        min_val = float('inf')
        next_cell = None
        for x, y in [(i+1, j), (i-1, j), (i, j+1), (i, j-1)]:
            if 0 <= x < N and 0 <= y < N and grid[x][y] < min_val:
                min_val = grid[x][y]
                next_cell = (x, y)
        return dfs(next_cell[0], next_cell[1], path + [min_val])

    min_val = float('inf')
    start_cell = None
    for i in range(N):
        for j in range(N):
            if grid[i][j] < min_val:
                min_val = grid[i][j]
                start_cell = (i, j)

    return dfs(start_cell[0], start_cell[1], [min_val])

