def encrypt(s):
    encrypted = ''
    for char in s:
        if char.isalpha():
            shift = (ord(char) - ord('a') + 2) * 2
            new_char = chr((ord(char) - ord('a') + shift) % 26 + ord('a'))
            encrypted += new_char
        else:
            encrypted += char
    return encrypted

