    vowels = "aeiouAEIOU"
    for char in message:
        if char.isalpha():
            if char.lower() in vowels:
                encoded_message += chr((ord(char) + 2 - ord('a')) % 26 + ord('A'))
            else:
                encoded_message += char.swapcase()
        else:
            encoded_message += char
    return encoded_message

